import React from 'react';
import useFetch from "../checkin/config/useFetch";
import Loader from "../loader/Loader";
import SectorList from "./SectorList";

const AddSector = () => {
    const {loading, error, data} = useFetch({url: "api/protected/users/sectors/me"});
    const sectors = useFetch({url: "api/public/sectors"});
    if (loading || sectors.loading) {
        return <Loader className="page-loader"/>
    }


    const handleChange = (e) => {
        e.preventDefault();

    }

    const handleSubmit = (e) => {
        e.preventDefault();
    }
    return (
        <div>
            <form onSubmit={handleSubmit}>
                <div className="form-group form-group--left">
                    <label>Name</label>
                    <input type="text" className="form-control"  name="name"
                           onChange={handleChange}/>
                    <i className="form-group__bar"/>
                </div>

                <div className="demo-inline-wrapper mb-2">
                    <div className="checkbox checkbox--char">
                        <input type="checkbox" name="agreeTerms" id="agreeTerms" onChange={handleChange}/>
                            <label htmlFor="agreeTerms" className="bg-red checkbox__char">A</label>
                    </div>
                </div>

                <button type="submit" className="btn btn--icon login__block__btn"><i
                    className="zmdi zmdi-long-arrow-right text-white"/></button>
            </form>

            {(!error && data.length > 0) ? (<SectorList {...data[0]}/>) : ''}
        </div>
    );
};

export default AddSector;
